contracts/BaseLearn/FavoriteRecords3.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.26;

contract FavoriteRecords {
    // Mapping para almacenar los álbumes aprobados
    mapping(string => bool) private approvedRecords;

    // Mapping para almacenar los álbumes favoritos de los usuarios
    mapping(address => mapping(string => bool)) public userFavorites;

    // Constructor para inicializar algunos álbumes aprobados
    constructor() {
        approvedRecords["Thriller"] = true;
        approvedRecords["Back in Black"] = true;
    }

    // Función para agregar registros de álbumes de usuarios
    function addRecord(string memory _albumName) public {
        require(approvedRecords[_albumName], "El album no esta aprobado");
        userFavorites[msg.sender][_albumName] = true;
    }

    // Función para verificar si un álbum está aprobado
    function obtienevaloralbum(string memory _albumName) public view returns (bool) {
        return approvedRecords[_albumName];
    }
}

